import './header.css';
import MyNavListComp from '../nav-list/nav-list';

export default function HeaderComp() {

    const logoName = 'LoGo';

    return (
        <header>
            <div className="wrapper-header">
                <span className="logo">{logoName}</span>
                <MyNavListComp/>
            </div>
        </header>
    )
}



